response.about:
Год выпуска - Июнь 1990г;
Страна производителя - Россия;
Пробег - 20 лет;
Регистрация - Южно-Сахалинск;
Цвет - Темный;
Высота - 165 см;
Фары - Карие;
Эксплуатация - Бережная;
Кузов - Не битый, не ржавый, антикор;
Тип топлива - Всё, что горит;
Расход топлива - Максимальный;
Резина - Шипованная;
На крутых поворотах иногда заносит;
Крыша - На месте, без присмотра подвержена деформации;
Руль - Легкий, но при неаккуратном обращении может клинить и отказывать в управлении вовсе;
Салон - Цвета кожи;
Музыка (стерео) с двумя динамиками по центру вверху (включается самопроизвольно и без предупреждения);
Заводится с пол-оборота. Без проблем даже утром и в мороз;
Готов к зимней эксплуатации и долгому пробегу в зимнее время;
Идеальное состояние. Все новое. Все опции;
Требует установки противоугонной системы;
Количество предыдущих владельцев не установлено;
Документы - На руках;
Тест-драйв - обговаривается заранее;
Отдается в хорошие руки по доверенности или с полным переоформлением;
Посредников просьба не беспокоить.
